import React, { useState, useEffect } from "react";
import carServices from "../services/carServices";
import typeCarServices from "../services/typecarServices";
import { Link } from 'react-router-dom';
import Swal from "sweetalert2";
import AuthServices from '../services/authServices';

const CarCreate = () => {
  const initialCarState = {
    licencePlate: "",
    description: "",
    imagen: null,
    cylinder_capacity: "",
    capacity: 0,
    model_year: "",
    typeCar: null,
  };

  const [car, setCar] = useState(initialCarState);
  const [typeCar, setTypeCar] = useState([]);
  const [type, setType] = useState(null);
  const [errors, setErrors] = useState({});
  const [carArray, setCarArray] = useState([]);
  const [validate, setValidate] = useState(false);

  const handleInputChange = (event) => {
    const { name, value } = event.target;
    setCar({ ...car, [name]: value });
  };

  const handleInputBlur = (event) => {
    handleInputChange(event);
    setErrors(validationError(car));
  };

  useEffect(() => {
    getList();
    getCar();
    if (validate) newCar();
  }, [validate]);

  const getList = () => {
    const token = AuthServices.getAuthToken();
    if (token) {
      typeCarServices.setAuthToken(token);
      console.log('Token :', token);
    } else {
      console.error("No se encontró un token válido");
      console.log('Token :', token);
      return;
    }
    typeCarServices
      .getAll()
      .then((response) => {
        setTypeCar(response.data);
        console.log(response.data);
      })
      .catch((e) => {
        console.log(e);
      });
  };

  const getCar = () => {
    const token = AuthServices.getAuthToken();
    if (token) {
      carServices.setAuthToken(token);
      console.log('Token :', token);
    } else {
      console.error("No se encontró un token válido");
      console.log('Token :', token);
      return;
    }
    carServices
      .getAll()
      .then((response) => {
        setCarArray(response.data);
        console(response.data);
      })
      .catch((e) => {
        console.log(e);
      });
  };

  const createCar = (e) => {
    e.preventDefault();
    const token = AuthServices.getAuthToken();
    if (token) {
      carServices.setAuthToken(token);
      console.log('Token :', token);
    } else {
      console.error("No se encontró un token válido");
      console.log('Token :', token);
      return;
    }

    setErrors(validationError(car));

    if (Object.keys(errors).length === 0) {
      carServices
        .create(
          car.licencePlate,
          car.description,
          car.imagen,
          car.cylinder_capacity,
          car.capacity,
          car.model_year,
          type
        )
        .then((response) => {
          setCar({
            licencePlate: response.data.licencePlate,
            description: response.data.description,
            imagen: response.data.imagen,
            cylinder_capacity: response.data.cylinder_capacity,
            capacity: response.data.capacity,
            model_year: response.data.model_year,
            typeCar: response.data.typeCar,
          });
          setValidate(true);
          console.log(response.data);
          Swal.fire({
            position: 'top-center',
            icon: 'success',
            title: 'Vehículo Registrado Correctamente',
            showConfirmButton: false,
            timer: 2200
          });
        })
        .catch((e) => {
          console.log(e);
        });
    }
  };

  const newCar = () => {
    setCar(initialCarState);
    setTypeCar([]);
    setValidate(false);
  };

  const validationError = (car) => {
    let errors = {};

    carArray.forEach((car) => {
      if (car.licencePlate === car.licencePlate) {
        errors.licencePlate = "Este número de placa ya existe";
      }
    });

    return errors;
  };

  return (
    <div className="container">
      <div className="submit-form">
        <div className="card">
          <div className="card-body">
            <h4>Registrar Vehículo</h4>
            <blockquote className="blockquote mb-0">
              <form
                onSubmit={createCar}
                className="row g-3 needs-validation my-3 border = 1"
              >
                <div className="col-md-3 position-relative">
                  <label htmlFor="licencePlate" className="form-label">
                    Placa
                  </label>
                  <div className="input-group has-validation">
                    <span className="input-group-text">
                      <i className="bi bi-pencil-square"></i>
                    </span>
                    <input
                      type="text"
                      className={
                        (errors.licencePlate ? "is-invalid" : "") +
                        " form-control"
                      }
                      id="licencePlate"
                      value={car.licencePlate}
                      placeholder="ABC - 1265"
                      onBlur={handleInputBlur}
                      onKeyUp={handleInputBlur}
                      onChange={handleInputChange}
                      name="licencePlate"
                      required
                    />
                    <small className="invalid-feedback" id="helpId">
                      <i className="bi bi-exclamation-circle">
                        {" "}
                        {errors.licencePlate}
                      </i>
                    </small>
                  </div>
                </div>

                <div className="col-md-3 position-relative">
                  <label htmlFor="description" className="form-label">
                    Marca
                  </label>
                  <div className="input-group has-validation">
                    <span className="input-group-text">
                      <i className="bi bi-pencil-square"></i>
                    </span>
                    <input
                      type="text"
                      className="form-control"
                      id="description"
                      value={car.description}
                      placeholder="Toyota, Porsche, etc..,"
                      onChange={handleInputChange}
                      name="description"
                      required
                    />
                  </div>
                </div>

                <div className="col-md-3 position-relative">
                  <label htmlFor="image" className="form-label">
                    Link Imagen
                  </label>
                  <div className="input-group has-validation">
                    <span className="input-group-text">
                      <i className="bi bi-image"></i>
                    </span>
                    <input
                      type="text"
                      className="form-control"
                      id="image"
                      value={car.imagen}
                      placeholder="https://th.bing.com/th/id=ImgDet&rs=1"
                      onChange={handleInputChange}
                      name="image"
                    />
                  </div>
                </div>

                <div className="col-md-3 position-relative">
                  <label htmlFor="cylinder_capacity" className="form-label">
                    Cilindraje
                  </label>
                  <div className="input-group has-validation">
                    <span className="input-group-text">
                      <i className="bi bi-gear-wide-connected"></i>
                    </span>
                    <input
                      type="text"
                      className="form-control"
                      id="cylinder_capacity"
                      value={car.cylinder_capacity}
                      placeholder="166 CV (124kW) 2694 cm 3. 2.8d"
                      onChange={handleInputChange}
                      name="cylinder_capacity"
                      required
                    />
                  </div>
                </div>

                <div className="col-md-3 position-relative">
                  <label htmlFor="capacity" className="form-label">
                    Capacidad
                  </label>
                  <div className="input-group has-validation">
                    <span className="input-group-text">
                      <i className="bi bi-car-front"></i>
                    </span>
                    <input
                      type="text"
                      className="form-control"
                      id="capacity"
                      value={car.capacity}
                      placeholder="2, 4, 5, 7, etc..."
                      onChange={handleInputChange}
                      name="capacity"
                      required
                    />
                  </div>
                </div>

                <div className="col-md-3 position-relative">
                  <label htmlFor="model_year" className="form-label">
                    Modelo
                  </label>
                  <div className="input-group has-validation">
                    <span className="input-group-text">
                      <i className="bi bi-calendar-date"></i>
                    </span>
                    <input
                      type="text"
                      className="form-control"
                      id="model_year"
                      value={car.model_year}
                      placeholder="Año 2020, 2022, 2018, etc..."
                      onChange={handleInputChange}
                      name="model_year"
                      required
                    />
                  </div>
                </div>

                <div className="form-group">
                  <label htmlFor="typeCar" className="form-label">
                    <i className="bi bi-car-front-fill"> </i>Tipo de Vehículo
                  </label>
                  <div className="form-group">
                    <select
                      className="form-select"
                      name="typeCar"
                      id="typeCar"
                      onChange={(e) => {
                        console.log(JSON.parse(e.target.value));
                        setType(JSON.parse(e.target.value));
                      }}
                    >
                      <option selected>Seleccione un Tipo de Vehículo</option>
                      {typeCar &&
                        typeCar.map((type) => (
                          <option
                            key={type.id_typeCar}
                            value={JSON.stringify(type)}
                          >
                            {type.description}
                          </option>
                        ))}
                    </select>
                  </div>
                </div>

                <div className="col-12">
                  <button
                    className="btn btn-success my-3 mx-2"
                    type="submit"
                  >
                    <i className="bi bi-person-plus"> Registrar</i>
                  </button>
                  <Link className="btn btn-danger" to={"/CarList"}>
                    <i className="bi bi-x-circle"> Cancelar</i>
                  </Link>
                </div>
              </form>
            </blockquote>
          </div>
        </div>
      </div>
    </div>
  );
};

export default CarCreate;
